(4, 'default', 'Email template updated.', 'App\\Models\\EmailTemplate', 9, 'App\\Models\\Admin', 1, '{\"id\":9,\"name\":\"Client profile update notification\",\"subject\":\"Profile Update Complete\",\"body\":\"<p><br \\/>\\r\\n<b>Account Name :&nbsp;<\\/b>[client_name]<\\/p>\\r\\n\\r\\n<p>This is a notification to inform you that your Client Profile has been updated.&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>If your personal circumstances or investment objectives have changed in any material way, we ask that you please inform us or complete the attached Client Profile form and either fax or post it back to us, or you can use the online form at:&nbsp;<a href=\\\"http:\\/\\/localhost\\/lvc\\/\\\">http:\\/\\/localhost\\/lvc\\/<\\/a><a href=\\\"http:\\/\\/localhost\\/lvc\\/portal\\/client\\/edit-profile\\\">portal\\/client\\/edit-profile<\\/a><\\/p>\\r\\n\\r\\n<p>If you have not filled out a Client Profile form before, or if the&nbsp;<b>Account Details<\\/b>&nbsp;below are inaccurate or incomplete please take this opportunity to complete one and return to us. The more information we have about your Personal Circumstances, the more Personal Advice can be tailored to your individual needs.<\\/p>\\r\\n\\r\\n<p>Alternatively if you meet the requirements of a Sophisticated Investor you can forward this email to your accountant and have him\\/her complete the 708 (8) Qualified Accountants Certificate attached. If you qualify as a sophisticated investor, as determined by your accountant, you may participate in Capital Raisings, including Placements which are not available to Retail Clients.<\\/p>\\r\\n\\r\\n<p>For your reference we have also attached another copy of our latest Financial Services Guide.<\\/p>\\r\\n\\r\\n<h3>Many thanks,<\\/h3>\\r\\n\\r\\n<p>[advisor_name]<\\/p>\\r\\n\\r\\n<p><strong>LA VERNE CAPITAL<br \\/>\\r\\nVisit our website at www.lavernesecurities.com.au<\\/strong><\\/p>\",\"created_at\":\"2022-12-12 21:31:49\",\"updated_at\":\"2022-12-12T10:32:39.621526Z\"}', '2022-12-12 16:02:39', '2022-12-12 16:02:39'),
