INSERT INTO `external_email_templates` (`id`, `name`, `subject`, `body`, `created_at`, `updated_at`) VALUES
(2, 'Admin welcome email', 'Welcome to Blessed Quest', '<h1>Welcome to Blessed Quest</h1>\r\n\r\n<p><b>Please login using below details.</b></p>', '2022-12-12 16:01:49', '2024-12-11 17:47:21'),
(3, 'Password reset email', 'Reset forgotten password', '<p>[textAboveLink]</p><p>You are receiving this email because we received a password reset request for your account.</p><p>[/textAboveLink] [textBelowLink]</p><p>This password reset link will expire in 60 minutes.</p><p>If you did not request a password reset, no further action is required.</p><p>[/textBelowLink]</p>', '2022-12-12 16:01:49', '2022-12-12 16:01:49'),
(4, 'Password change notification email', 'Your password has changed', '<p>You have successfully reset your password.<br />You can now login with your new password using below link.</p>', '2022-12-12 16:01:49', '2022-12-12 16:01:49'),
(8, 'Reminders your credits expire', 'Reminders your credits expire', '<p>Reminders your credits are about to expire on date :- [date].</p>\r\n\r\nThank you.', '2023-01-05 06:22:11', '2024-10-29 16:06:39'),
(10, 'Reminders your subscription auto-renews', 'Reminders your subscription auto-renews', '<p>Reminders your subscription auto-renews on date :- [date].</p>\r\n\r\nThank you.', '2023-01-05 06:22:11', '2024-10-29 16:06:39'),
(11, 'Forgot password', 'Forgot password', '<p>You recently requested to reset your password for your&nbsp;Blessed Quest account. Use the One-Time Password (OTP) below to proceed with the password reset process:</p>\r\n\r\n<p><b>OTP : [otp]</b></p>\r\n\r\n<p>This OTP is valid for 10 minutes only. Please do not share this code with anyone for security reasons.</p>\r\n\r\n<p>If you did not request a password reset, please ignore this email or contact our support team immediately.</p>\r\n\r\n<p>Need Help? If you have any questions, please reach out to us at abcd@yopmail.com .</p>\r\n\r\n<p>Thank you,</p>', '2022-12-12 16:01:49', '2024-12-30 18:46:13'),
(12, 'Client welcome email', 'Welcome to Blessed Quest', '<h1>Welcome to Blessed Quest</h1>\r\n\r\n<p>You can login using below details.</p>', '2022-12-12 16:01:49', '2024-12-11 17:47:47'),
(13, 'Welcome to Blessed Quest', 'Welcome to Blessed Quest', '<p>Your account has been successfully created. We&#39;re excited to get you started. Your account details are as follows:</p>\r\n\r\n<p>Email address:- [email],</p>\r\n\r\n<p>Password :- [password],</p>\r\n\r\n<p>Thank you!</p>\r\n\r\n<p>Please contact to administrator, If you have any query.</p>\r\n\r\n<p>Sincerely,</p>\r\n\r\n<p>Blessed Quest</p>', '2023-01-05 06:22:11', '2025-01-08 14:49:06'),
(14, 'Change Password OTP', 'Change Password OTP', '<p>Thank you for choosing a&nbsp;Blessed Quest.</p>\r\n\r\n<p>Please find below OTP for change/forgot password</p>', '2023-01-05 06:22:11', '2024-12-20 11:10:36'),
(16, 'Resend email verification OTP', 'Resend email verification OTP', '\r\n<p>Email address:- [email],</p>\r\n\r\n<p>Please verify your account with below OTP :-</p>', '2023-01-05 06:22:11', '2024-10-29 16:06:39'),
(17, 'Password change notification email', 'Your password has changed', '<p>You have successfully reset your password.</p>', '2023-01-05 06:22:11', '2024-10-29 16:06:39'),
(21, 'Updates your account information', 'Updates your account information', '<p>Updates your account information .</p>', '2023-01-05 06:22:11', '2024-10-29 16:06:39');
